  data:
    liveness_probe.sh: "#!/bin/bash\nset -e\nif [ -d \"/opt/eap/bin\" ]; then\n\t/opt/eap/bin/livenessProbe.sh\nelse\n\tcurl
      -s --max-time 10 --fail http://$(hostname -i):8080/auth > /dev/null\nfi\n"
    readiness_probe.sh: "#!/bin/bash\nset -e\n\nif [ -d \"/opt/eap/bin\" ]; then\n\t/opt/eap/bin/readinessProbe.sh\nelse\n\tDATASOURCE_POOL_TYPE=\"data-source\"\n\tDATASOURCE_POOL_NAME=\"KeycloakDS\"\n\t\n\tPASSWORD_FILE=\"/tmp/management-password\"\n\tPASSWORD=\"not
      set\"\n\tUSERNAME=\"admin\"\n\tAUTH_STRING=\"\"\n\n    pushd /opt/jboss/keycloak/bin
      > /dev/null\n\tif [ -f \"$PASSWORD_FILE\" ]; then\n\t\tPASSWORD=$(cat $PASSWORD_FILE)\n\telse\n\t\tPASSWORD=$(cat
      /dev/urandom | tr -dc 'a-zA-Z0-9' | fold -w 32 | head -n 1)\n\t\t./add-user.sh
      -u $USERNAME -p $PASSWORD> /dev/null\n\t\techo $PASSWORD > $PASSWORD_FILE\n\tfi\n\tAUTH_STRING=\"--digest
      -u $USERNAME:$PASSWORD\"\n\t\n\tcurl -s --max-time 10 --fail http://localhost:9990/management
      $AUTH_STRING --header \"Content-Type: application/json\" -d \"{\\\"operation\\\":\\\"test-connection-in-pool\\\",
      \\\"address\\\":[\\\"subsystem\\\",\\\"datasources\\\",\\\"${DATASOURCE_POOL_TYPE}\\\",\\\"${DATASOURCE_POOL_NAME}\\\"],
      \\\"json.pretty\\\":1}\"\n\tcurl -s --max-time 10 --fail http://$(hostname -i):8080/auth
      > /dev/null\nfi\n"
